INSERT INTO `productos` VALUES (1,'One-Punch Man, Vol. 1','Temp. 1','Vol. 1','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nEvery time a promising villain appears, Saitama beats the snot out of ’em with one punch! Can he finally find an opponent who can go toe-to-toe with him and give his life some meaning? Or is he doomed to a life of superpowered boredom?',9.99,'2015-09-01','one-punch-man-vol-1-9781421585642_hr.jpg',18.981,1,14,2,109),(2,'One-Punch Man, Vol. 2','Temp. 1','Vol. 2','Life gets pretty boring when you can beat the snot out of any villain with just one punch','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nSaitama’s easily taken out a number of monsters, including a crabby creature, a malicious mosquito girl and a muscly meathead. But his humdrum life takes a drastic turn when he meets Genos—a cyborg who wants to uncover the secret behind his strength!',9.99,'2015-09-01','one-punch-man-vol-2-9781421585659_hr.jpg',18.981,0,0,2,109),(3,'One-Punch Man, Vol. 3','Temp. 1','Vol. 3','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nFor three years, Saitama has defeated countless monsters, but no one knows about him… That’s because he isn’t in the Hero Association’s registry! Together with Genos, Saitama decides to take the Hero Association’s test! But can they pass?!',9.99,'2015-11-03','one-punch-man-vol-3-9781421564616_hr.jpg',18.981,1,22,2,109),(4,'One-Punch Man, Vol. 4','Temp. 1','Vol. 4','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nSaitama is now a certified hero! And with that title comes great responsibility—he’s required to perform one heroic deed per week. While Saitama makes the rounds to meet his quota, an incoming threat from outer space is screeching toward Earth...',9.99,'2016-01-05','one-punch-man-vol-4-9781421569208_hr.jpg',18.981,1,15,2,109),(5,'One-Punch Man, Vol. 5','Temp. 1','Vol. 5','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nTo stop a Demon-level crisis, Saitama and company head toward the action. However, even Class-S heroes prove to be no match for the Deep Sea King! In order to protect the good citizens, our heroes will need to summon all of their courage and confront this threat!',9.99,'2016-03-01','one-punch-man-vol-5-9781421569543_hr.jpg',18.981,0,0,2,109),(6,'One-Punch Man, Vol. 6','Temp. 1','Vol. 6','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nAn emergency summons gathers Class S heroes at headquarters…and Saitama tags along. There, they learn that the great seer Shibabawa left the following prophecy: “The Earth is in danger!” What in the world is going to happen?!',9.99,'2016-05-03','one-punch-man-vol-6-9781421585277_hr.jpg',18.981,1,13,2,109),(7,'One-Punch Man, Vol. 7','Temp. 1','Vol. 7','Life gets pretty boring when you can beat the snot out of any villain with just one punc','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nWhen aliens invade Earth, a group of Class-S heroes finally finds a way to fight back and go on the offensive. Inside the enemy mother ship, Saitama fights Boros. Faced with the alien’s frightful power, he decides to get serious! What is the Earth’s fate?!',9.99,'2016-07-05','one-punch-man-vol-7-9781421585284_hr.jpg',18.981,0,0,2,109),(8,'One-Punch Man, Vol. 8','Temp. 1','Vol. 8','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nClass-S hero King is known as the strongest man on earth. Even monsters fear him. But when a mysterious organization sends an assassin after him, the shocking truth about King is revealed!',9.99,'2016-09-06','one-punch-man-vol-8-9781421586564_hr.jpg',18.981,1,8,2,109),(9,'One-Punch Man, Vol. 9','Temp. 1','Vol. 9','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nTime bomb Garo, a monster admirer, finally explodes, attacking the Hero Association! Meanwhile, Miss Blizzard visits Saitama at his apartment. Because of his lower rank, she plans to make him one of her subordinates, but…',9.99,'2016-11-01','one-punch-man-vol-9-9781421586571_hr.jpg',18.981,1,15,2,109),(10,'One-Punch Man, Vol. 10','Temp. 1','Vol. 10','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nHero hunter Gato intensifies his onslaught, so of course Saitama decides now is the perfect time to join a combat tournament. Meanwhile, Class-S hero Metal Bat takes an assignment guarding a Hero Association executive and his son, and before long trouble appears!',9.99,'2017-01-03','one-punch-man-vol-10-9781421590158_hr.jpg',18.981,1,34,2,109),(11,'One-Punch Man, Vol. 11','Temp. 1','Vol. 11','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nWhile Saitama’s distracted at a martial arts tournament, Centichoro, a threat-level Dragon monster, attacks! Metal Bat engages it in battle but struggles against its gargantuan size. The monster knocks him into the distance and right into the path of hero-hunter Garo! ',9.99,'2017-03-07','one-punch-man-vol-11-9781421592268_hr.jpg',18.981,1,35,2,109),(12,'One-Punch Man, Vol. 12','Temp. 1','Vol. 12','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nAt the martial arts tournament, Suiryu of the Dark Body Art shows promise with his outstanding strength. But outside the stadium, a large number of monsters are pushing the heroes, even Genos, to their limits! Inside, unaware, Saitama approaches his match against Bakuzan!',9.99,'2017-09-05','one-punch-man-vol-12-9781421596204_hr.jpg',18.981,1,32,2,109),(13,'One-Punch Man, Vol. 13','Temp. 1','Vol. 13','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe Class-A heroes struggle in their fight against the giant monster Multieyed Octopus. Wait, is that Class-S hero Flashy Flash joining the fight?! Unfazed, the Monster Association continues ramping up its attacks, but its goal remains a mystery. Meanwhile, the martial arts tournament reaches the semifinals!',9.99,'2018-03-06','one-punch-man-vol-13-9781421598062_xlg.jpg',18.981,1,13,2,109),(14,'One-Punch Man, Vol. 14','Temp. 1','Vol. 14','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe monster Goketsu appears at the martial arts tournament, and in an attempt to turn its participants into monsters, he gives them monster cells. Tournament champ Suiryu fights the newly monsterized fighters one after another, until a certain hero rushes to his side to help!',9.99,'2018-07-03','one-punch-man-vol-14-9781974700431_hr.jpg',18.981,0,0,2,109),(15,'One-Punch Man, Vol. 15','Temp. 1','Vol. 15','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nDespite just finishing a martial arts tournament and immediately dealing with the Monster Association invasion, Saitama still proves to be so incredibly strong that he feels empty inside. King lectures him on how to live like a hero, but it doesn’t help. Meanwhile, servants of the Monster Association close in on Speed-o’-Sound Sonic!',9.99,'2019-01-01','one-punch-man-vol-15-9781974702237_xlg.jpg',18.981,1,34,2,109),(16,'One-Punch Man, Vol. 16','Temp. 1','Vol. 16','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nSurrounded by heroes, Garo finds himself in a tight spot. But despite the great numbers, he defeats the heroes one by one with his unmatched strength before Genos comes rushing in! Meanwhile, Saitama is reaching the height of irritation in his own battle…with King?!',9.99,'2019-05-07','one-punch-man-vol-16-9781974704613_xlg.jpg',18.981,1,29,2,109),(17,'One-Punch Man, Vol. 17','Temp. 1','Vol. 17','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe hero hunter is near death when the Monster Association attempts to steal him away, unleashing Centichoro in the process. Bang and company face it head-on before Genos boldly enters the fray!',9.99,'2019-08-06','one-punch-man-vol-17-9781974707454_xlg.jpg',18.981,1,3,2,109),(18,'One-Punch Man, Vol. 18','Temp. 1','Vol. 18','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nGaro has just left the Monster Association’s hideout when he crosses paths with Saitama, who’s in quite a pickle, but Saitama still doesn’t know Garo is the Hero Hunter. Later, King the Ripper can no longer hold back his murderous urges and confronts Garo himself!',9.99,'2019-12-03','one-punch-man-vol-18-9781974709465_xlg.jpg',18.981,1,39,2,109),(19,'One-Punch Man, Vol. 19','Temp. 1','Vol. 19','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe Monster Association has kidnapped Tareo, the boy who admires Garo, and now Garo finds himself plunging headfirst and alone into the heart of the Monster Association’s hideout. Meanwhile, the Hero Association pushes forward with its operation to rescue Waganma, while Genos and the others are living it up enjoying hot pot at Saitama’s place! ',9.99,'2020-03-03','one-punch-man-vol-19-9781974711703_xlg.jpg',18.981,1,33,2,109),(20,'One-Punch Man, Vol. 20','Temp. 1','Vol. 20','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nImmediately before the big Monster Association battle, the Class-S heroes hold a strategy meeting. Unfortunately, they just aren’t in sync, and when Amai Mask barges in, the situation only gets worse. Thankfully, King appears just in time to boost their morale—and it’s a good thing, too, because suddenly the big monster battle begins!',9.99,'2020-07-07','one-punch-man-vol-20-9781974714742_xlg.jpg',18.981,1,7,2,109),(21,'One-Punch Man, Vol. 21','Temp. 1','Vol. 21','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe curtain rises on the big battle between the Monster Association and heroes! As the lower-ranked heroes engage in intense battle, the Class-S crew takes out many monsters in one fell swoop before venturing further underground. Among them, Flashy Flash demonstrates splendid battle prowess against a duo of monstrous ninja!',9.99,'2020-10-06','one-punch-man-vol-21-9781974717644_xlg.jpg',18.981,1,27,2,109),(22,'One-Punch Man, Vol. 22','Temp. 1','Vol. 22','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nChild Emperor uses his trump card, the robotic Brave Giant, to fight against the reincarnated Phoenix Man. However, his enemy easily counters this last-ditch attempt, brushing Brave Giant off as a mere toy. When Phoenix Man then evolves into an even stronger monster, Child Emperor’s conviction is shaken. Does this spell the end for the clever child hero?',9.99,'2021-06-01','one-punch-man-vol-22-9781974722907_xlg.jpg',18.981,1,41,2,109),(23,'One-Punch Man, Vol. 23','Temp. 1','Vol. 23','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nNarinki’s private force is now free from Super S’s control. Bushi Drill, Okama Itachi and Iaian plot their escape, but threat level Demon monster Malong Hair appears before they can flee, and a fierce fight breaks out. Elsewhere, their master Atomic Samurai encounters a creepy opponent!',9.99,'2021-10-05','one-punch-man-vol-23-9781974725120_xlg.jpg',18.981,1,5,2,109),(24,'One-Punch Man, Vol. 24','Temp. 1','Vol. 24','Life gets pretty boring when you can beat the snot out of any villain with just one punch.','Nothing about Saitama passes the eyeball test when it comes to superheroes, from his lifeless expression to his bald head to his unimpressive physique. However, this average-looking guy has a not-so-average problem—he just can’t seem to find an opponent strong enough to take on!\n\nThe dangerous monster that can’t be cut, Evil Mineral Water, confronts Bushi Drill, Okama Itachi, and Iaian. Meanwhile, Saitama runs into the giant demonic dog Pochi, and Terrible Tornado launches into an epic supernatural battle against Gyoro-Gyoro!',9.99,'2022-11-01','one-punch-man-vol-24-9781974734405_xlg.jpg',18.981,0,0,2,109),(25,'Aburrimiento','Temp. 1','Vol. 1','Death Note, Vol. 1','Light Yagami, un estudiante de secundaria prodigio, está insatisfecho de llevar una vida ordinaria y aburrida hasta que encuentra un cuaderno sobrenatural, llamado «Death Note», el cual es capaz de matar a cualquier persona con tan sólo escribir su nombre en él y visualizar mentalmente su cara. Tras probar su poder en dos ocasiones y luego de cinco días de usarlo, recibe la visita del verdadero dueño de la libreta, un shinigami llamado Ryuk, quien le explica que lo acompañara durante el tiempo que sea dueño de la libreta.',9.99,'2004-04-02','DN-VOLUMEN_1.jpg',18.981,1,32,2,109),(26,'Confluencia','Temp. 1','Vol. 2','Death Note, Vol. 2','Armado con el nombre del detective que lo ha estado siguiendo, Light acaba con sus problemas con el FBI mediante el uso del Death Note, el cual usó para matar a Raye Penber y a todos los detectives de Estados Unidos enviados a Japón. Al poco tiempo, Light cruza caminos con la prometida de Penber, Naomi Misora que, con sus propias conclusiones, se convierte en una amenaza para Light cuando ésta intenta contactar a L',9.99,'2004-06-02','DN-VOLUMEN_2.jpg',18.981,1,6,2,109),(27,'Arrebato de furia','Temp. 1','Vol. 3','Death Note, Vol. 3','Con el apoyo de Ryuk, Light comprueba la presencia de cámaras y, con una nueva estrategia, continúa castigando criminales a la vez que pretende ser un estudiante ordinario ante la vigilancia de L. Con el paso del tiempo, L descarta sus sospechas sobre las familias de los miembros de la investigación y sorprende a Light en su primer día como universitario al presentarse como un compañero en su ceremonia de ingreso.',9.99,'2004-09-02','DN-VOLUMEN_3.jpg',18.981,1,38,2,109),(28,'Amor','Temp. 1','Vol. 4','Death Note, Vol. 4','Light es recibido en la investigación de L para reforzar la teoría de éste sobre el segundo Kira y, con su colaboración, consiguen enviarle un mensaje falso al segundo Kira que no sólo cae fácilmente sino que revela algunos detalles esenciales destacando la existencia de los shinigami. La segunda Kira es en realidad Misa Amane: una ídola pop japonesa que obtuvo su propia Death Note bajo circunstancias diferentes a Light y espera apoyar a Kira al compartir sus ideales.',9.99,'2004-11-04','DN-VOLUMEN_4.jpg',18.981,1,26,2,109),(29,'En blanco','Temp. 1','Vol. 5','Death Note, Vol. 5','Light renuncia a la propiedad de su Death Note para perder sus recuerdos y ante la inminente aparición de otro Kira al cabo de unas semanas después de su arresto y el de Misa, L se ve obligado a liberarlos pero los mantiene bajo vigilancia las 24 horas del día a la vez que esposa a Light a su lado para que juntos atrapen al nuevo Kira. Gracias a la colaboración de los dos, descubren que los asesinatos de Kira han beneficiado a una empresa japonesa llamada Yotsuba',9.99,'2005-02-04','DN-VOLUMEN_5.jpg',18.981,1,4,2,109),(30,'Intercambio','Temp. 1','Vol. 6','Death Note, Vol. 6','Luego de conseguir volver a Namikawa (uno de los miembros del grupo Yotsuba) en su espía interno para detener los asesinatos de Kira, L queda impresionado y le ofrece a Light la oferta de ser su sucesor aunque éste lo rechaza, ya que sólo le interesa atrapar a Kira. Dado que L comienza a tener conflictos con el resto del grupo con sus métodos para atrapar a Kira, decide involucrar a Misa en la investigación debido a su antigua conexión con Kira.',9.99,'2005-04-04','DN-VOLUMEN_6.jpg',18.981,0,0,2,109),(31,'Cero','Temp. 1','Vol. 7','Death Note, Vol. 7',' Poco después del arresto de Higuchi, Light al tocar el Death note recupera todos sus recuerdos y se prepara para la siguiente etapa de sus planes. Habiendo asesinado a Higuchi para conseguir la posesión del Death Note, Light guía a Misa a encontrar su propia Death Note y gracias a que Misa realiza el trato de los ojos de shinigami de nuevo, ella comienza a matar a criminales para confundir al equipo de investigación.',9.99,'2005-07-04','DN-VOLUMEN_7.jpg',18.981,1,27,2,109),(32,'Objetivo','Temp. 1','Vol. 8','Death Note, Vol. 8','Sin más opción que acceder a las exigencias de Mello y sus hombres, el equipo accede a entregar la Death Note y aunque Light considera asesinar a su hermana para evitar la entrega de la libreta, la pandilla de Mello consigue escapar con el death note. Gracias al uso de la libreta Mello comienza a extorsionar tanto a la policía japonesa como al gobierno de los Estados Unidos lo que obliga a Light a aliarse con Near quien le revela a Light que tanto el cómo Mello buscan terminar lo que L empezó: atrapar a Kira.',9.99,'2005-09-02','DN-VOLUMEN_8.jpg',18.981,1,39,2,109),(33,'Contacto','Temp. 1','Vol. 9','Death Note, Vol. 9','Decidido a recuperar el Death Note y ahora consciente de la participación del shinigami Sidoh; Light elabora un plan para proporcionarle al equipo de investigación una de sus death note y así organizar una redada en contra de la pandilla con la que Mello está asociado.',9.99,'2005-12-02','DN-VOLUMEN_9.jpg',18.981,1,17,2,109),(34,'Supresión','Temp. 1','Vol. 10','Death Note, Vol. 10','Near y su grupo junto a Mogi escapan de la turba enviada por Light y como resultado Aizawa comienza a sospechar de nuevo de Light hasta el punto en que se comunica con Near para revelarle detalles sobre lo ocurrido en el equipo de investigación y vigila Misa para descartar que tenga una libreta.',9.99,'2006-02-03','DN-VOLUMEN_10.jpg',18.981,1,11,2,109),(35,'Unanimidad','Temp. 1','Vol. 11','Death Note, Vol. 11','Near anuncia su arribo a Japón ante Light para continuar con la investigación de Kira, en respuesta Light ordena a Mikami a utilizar el death note en público a sabiendas de que podría ser sospechoso en la subsecuente investigación.',9.99,'2006-05-02','DN-VOLUMEN_11.jpg',18.981,1,35,2,109),(36,'Final','Temp. 1','Vol. 12','Death Note, Vol. 12','Pese a los esfuerzos de la policía por localizar a Kiyomi y aprender a Mello, ambos acaban muriendo de acuerdo al plan de Light cuando consigue que su vocera aniquile a su secuestrador y luego la asesina al inducirle que se suicide incendiando todo a su alrededor. En el día de la reunión Near explica que ha deducido el método para capturar a Kira al cambiar la Death note por una replica y que solo tienen que esperar a que Kira y su súbdito intenten asesinar a los presentes.',9.99,'2006-06-04','DN-VOLUMEN_12.jpg',18.981,1,2,2,109),(37,'Cómo leer','Temp. 1','Vol. 13','Death Note, Vol. 13','Este es un volumen especial, es una guía que contiene datos relacionados con la serie, anécdotas sobre la producción de ésta, el perfil de todos los personajes principales, además de una copia del capítulo piloto en el que se basó el manga; el volumen también contiene entrevistas exclusivas con los creadores de la serie, Tsugumi Ōba y Takeshi Obata.',9.99,'2006-10-13','DN-VOLUMEN_13.jpg',18.981,1,19,2,109),(38,'Mobile Suit Gundam Thunderbolt, Vol. 1','Temp. 1','Vol. 1','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nInto this maelstrom of destruction go two veteran Mobile Suit pilots: the deadly Zeon sniper Daryl Lorenz, and Federation ace Io Fleming. It’s the beginning of a rivalry that can end only when one of them is destroyed. The lightning-streaked debris fields are about to become the stage for an epic duel where death is the only true winner.',14.99,'2016-11-15','mobile-suit-gundam-thunderbolt-vol-1-9781421590554_hr.jpg',28.481,1,21,2,109),(39,'Mobile Suit Gundam Thunderbolt, Vol. 2','Temp. 1','Vol. 2','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nIn the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.',14.99,'2017-02-21','mobile-suit-gundam-thunderbolt-vol-2-9781421592602_hr.jpg',28.481,1,3,2,109),(40,'Mobile Suit Gundam Thunderbolt, Vol. 3','Temp. 1','Vol. 3','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe Federation attack on the Zeon fleet in the Thunderbolt sector is a bloody fiasco as Io Fleming leads a squadron of inexperienced young pilots into the teeth of the Zeon defenses. Desperate, the Federation throws even the maintenance crews into the fray. Casualties mount as the two fleets clash, and Fleming and his Zeon rival, Daryl Lorenz, engage deep in the ruins of one of the space colonies. Shattered and driven by memories of the past and all they’ve lost, their duel resonates with the fierce emotions of both sides in this deadly conflict.',14.99,'2017-05-16','mobile-suit-gundam-thunderbolt-vol-3-9781421592619_hr.jpg',28.481,1,24,2,109),(41,'Mobile Suit Gundam Thunderbolt, Vol. 4','Temp. 1','Vol. 4','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe fleets of the Earth Federation’s Moore Brotherhood and the Republic of Zeon have shattered each other in a bloody battle for the Thunderbolt Sector. Mirroring the greater struggle, the ferocious duel between Io Fleming and Daryl Lorenz leaves both the Full Armor Gundam and the Psycho Zaku heavily damaged and Io a prisoner of war. The Zeon space habitat A Baoa Qu now becomes the final battleground of the One Year War…',14.99,'2017-08-15','mobile-suit-gundam-thunderbolt-vol-4-9781421593029_hr.jpg',28.481,1,30,2,109),(42,'Mobile Suit Gundam Thunderbolt, Vol. 5','Temp. 1','Vol. 5','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nOn Earth, political turmoil has led the Nanyang Alliance to challenge Federation control. Now in possession of Zeon’s priceless Reuse P Device technology, the Alliance moves forward with its plans. If they can develop the stolen tech, it could make them invincible. Both Io Fleming and Daryl Lorenz begin new operations against the Alliance on dangerous missions that are sure to bring them face-to-face once again…',14.99,'2017-11-21','mobile-suit-gundam-thunderbolt-vol-5-9781421593036_hr.jpg',28.481,0,0,2,109),(43,'Mobile Suit Gundam Thunderbolt, Vol. 6','Temp. 1','Vol. 6','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nFrom the frozen wastes of Antarctica to the abyssal depths of the ocean, Operation Thunderbolt is under way. Io Fleming heads back into battle aboard the Federation MS carrier Spartan. While taking a perilous course through the Antarctic Ocean, Spartan is pursued by a Zeon submarine unit. Io takes the controls of the awesome new RX-78AL Atlas Gundam, but as always, it’s not the machine but the pilot that makes the difference in the unforgiving crucible of combat. ',14.99,'2018-02-20','mobile-suit-gundam-thunderbolt-vol-6-9781421593043_hr.jpg',28.481,0,0,2,109),(44,'Mobile Suit Gundam Thunderbolt, Vol. 7','Temp. 1','Vol. 7','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nZeon ace Daryl Lorenz works to help Kara Mitchum, the brilliant designer of the Reuse P. Device, recover from the trauma she suffered in the Battle of the Thunderbolt Sector. Meanwhile, after a deadly pursuit and confrontation both in the frozen wastes of Antarctica and the black depths of the ocean, the Federation ship Spartan reaches the territory of the Nanyang Alliance. As the Spartan encounters the first Alliance border patrol units, Io Fleming learns that not all of the Thunderbolt Sector’s ghosts are dead...',14.99,'2018-05-15','mobile-suit-gundam-thunderbolt-vol-7-9781421595054_hr.jpg',28.481,1,23,2,109),(45,'Mobile Suit Gundam Thunderbolt, Vol. 8','Temp. 1','Vol. 8','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe mission to recover Zeon’s Reuse P. Device technology leads Daryl Lorenz and his unit to the Rig, a network of oil platforms inside Nanyang Alliance territory now repurposed as a floating city. The Rig is a haven for refugees and deserters from both sides of the war, all living under the watchful eye of the warrior monks of the Alliance. Ordered to infiltrate the Rig undercover, Lorenz and his team must make contact with a Zeon operative and begin a covert operation to learn the secrets of the Nanyang Alliance and its leader, Sojo Levan Fu, who plans to do far more than simply mass-produce the Psycho Zaku…',14.99,'2018-08-21','mobile-suit-gundam-thunderbolt-vol-8-9781421595061_hr.jpg',28.481,1,11,2,109),(46,'Mobile Suit Gundam Thunderbolt, Vol. 9','Temp. 1','Vol. 9','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nOn the Nanyang Alliance floating city known as the Rig, Daryl Lorenz and his Zeon infiltration team have made their move to grab the Alliance’s data on the production of the Psycho Zaku. But Claudia—now a convert and servant of the Alliance leader, Sojo Levan Fu—has discovered Daryl’s squad. A massacre is averted after Levan Fu channels his awesome Newtype psychic abilities through Claudia to speak to Daryl, urging him to give up the path of killing. As things come to a head, the Federation assault ship Spartan arrives…',14.99,'2018-11-20','mobile-suit-gundam-thunderbolt-vol-9-9781421599151_xlg.jpg',28.481,0,0,2,109),(47,'Mobile Suit Gundam Thunderbolt, Vol. 10','Temp. 1','Vol. 10','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nClaudia Peer has been captured by Zeon, which hopes that she will lead them to the location of the Psycho Zaku research facility. Daryl Lorenz brought Claudia in, but his encounter with Sojo Levan Fu has made him realize he shares her trauma. Elsewhere, the crew of the Spartan refit and rearm, and despite Io Fleming’s talent for combat, his hot temper fuels lingering doubts among the Federation command that he can get the job done. As the Spartan homes in on the hidden Zeon base, secret followers of Sojo Levan Fu among both Zeon and Federation forces make their move…',14.99,'2019-02-19','mobile-suit-gundam-thunderbolt-vol-10-9781974701070_xlg.jpg',28.481,1,26,2,109),(48,'Mobile Suit Gundam Thunderbolt, Vol. 11','Temp. 2','Vol. 11','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nAbandoning their allegiance to Zeon, Daryl Lorenz and Dr. Karla Mitchum join Federation defector Claudia Peer and head for the Nanyang Alliance’s Taal volcano base to dedicate themselves to the cause of Sojo Levan Fu. Once there, they learn the full extent of the Nanyang operation to mass-produce the Psycho Zaku and the Reuse P. Device, and Sojo Levan Fu’s ultimate plan to end humanity’s fall toward inevitable destruction! Daryl and Karla are the keys to this plan, but unlocking their shattered memories has unexpected dangers.',14.99,'2019-05-21','mobile-suit-gundam-thunderbolt-vol-11-9781974706464_xlg.jpg',28.481,1,30,2,109),(49,'Mobile Suit Gundam Thunderbolt, Vol. 12','Temp. 2','Vol. 12','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe Federation assault ship Spartan sets course for the Nanyang Alliance’s Psycho Zaku manufacturing base in the Taal volcano and begins preparing for full-scale combat operations. Io Fleming and the members of the Trust Squadron bond before the struggle to come, as Daryl Lorenz and his crew of Zeon defectors do the same. On the Spartan, Director Humphrey lays out the challenges of the assault—in addition to the Psycho Zaku the Federation will be facing Alliance forces under the psychic control of Sojo Levan Fu. However, Levan Fu will not be the only Newtype in the looming battle…',14.99,'2019-08-20','mobile-suit-gundam-thunderbolt-vol-12-9781974707461_xlg.jpg',28.481,0,0,2,109),(50,'Mobile Suit Gundam Thunderbolt, Vol. 13','Temp. 2','Vol. 13','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nNewtype Levan Fu has a grand vision of a time when mankind is at peace and free from the cycle of endless war. To realize this vision, he must first plunge himself and all his followers into the cauldron of battle. As the Federation assault on the Nanyang Alliance’s Taal volcano base begins, Daryl Lorenz and his squadron mates fight a rearguard action while the rest of the Alliance forces evacuate. On the other side, Federation ace Io Fleming leads the attack. The fate of humanity hangs in the balance as these two rival pilots prepare to cross swords once again.',14.99,'2020-02-18','mobile-suit-gundam-thunderbolt-vol-13-9781974711987_xlg.jpg',28.481,0,0,2,109),(51,'Mobile Suit Gundam Thunderbolt, Vol. 14','Temp. 2','Vol. 14','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe Nanyang Alliance desperately tries to evacuate their Psycho Zakus from the Taal Volcano base under intense pressure from the attacking Earth Federation forces. To cover the retreat, Daryl Lorenz and the members of his team try to hold off Io Fleming and his unit. But this face-off was always going to come down to Io and Daryl, whose rivalry has only intensified since they first dueled in the Thunderbolt Sector. Each will accept nothing less than total destruction of the other, but victory always comes at a price…',14.99,'2020-07-21','mobile-suit-gundam-thunderbolt-vol-14-9781974715329_xlg.jpg',28.481,0,0,2,109),(52,'Mobile Suit Gundam Thunderbolt, Vol. 15','Temp. 2','Vol. 15','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe battle for the Nanyang Alliance’s Taal volcano base is over. Sojo Levan Fu and his followers managed to evacuate the newly manufactured Psycho Zakus into orbit. But this victory came at a heavy price. During a ferocious rearguard action, Io—consumed by his bloodlust—accidentally killed someone dear to both he and Daryl. Enraged, Daryl destroyed the Spartan. In the aftermath of the battle, what’s left of the Spartan’s crew regroups to lick their wounds. Io lies in the infirmary, broken by what he’s done. But the war is not finished with Io Fleming, and will leave him with nothing when it’s over. Until then, he has only one job to do…',14.99,'2021-01-19','mobile-suit-gundam-thunderbolt-vol-15-9781974720729_xlg.jpg',28.481,1,12,2,109),(53,'Mobile Suit Gundam Thunderbolt, Vol. 16','Temp. 2','Vol. 16','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nDaryl Lorenz and his fellow Zeon defectors have made it back into space, but they’ve got the entire Earth Federation fleet between them and the Nanyang Alliance rendezvous point. Renegade Zeon General Galle can help, but his assistance comes at a price, and getting through the blockade will require an audacious plan that only Daryl Lorenz can pull off—stealing an advanced Mobile Armor equipped with the advanced Psycommu control system, right out from under the Federation’s noses!',14.99,'2021-08-17','mobile-suit-gundam-thunderbolt-vol-16-9781974722952_xlg.jpg',28.481,1,15,2,109),(54,'Mobile Suit Gundam Thunderbolt, Vol. 17','Temp. 2','Vol. 17','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nNanyang Alliance forces begin preparations for Operation Maitreya, their attempt to seize the Republic of Zeon’s Solar Ray weapon. The wreckage of the Side 4 Moore colony provides the ideal training environment for the assault, but Io Fleming and the Newtype Lily—piloting the cutting-edge Zeong MS and equipped with the Psycommu system—are closing in. Although the vast fields of debris give excellent cover, the Alliance deploys a new Psycho Zaku pilot to hold off Io and the oncoming Earth Federation fleet. As the combatants close to contact, the sound of jazz once again returns to the Thunderbolt Sector…',14.99,'2022-02-15','mobile-suit-gundam-thunderbolt-vol-17-9781974726530_xlg.jpg',28.481,0,0,2,109),(55,'Mobile Suit Gundam Thunderbolt, Vol. 18','Temp. 2','Vol. 18','An epic story of war and survival set in the legendary Gundam universe!','In the Universal Century year 0079, the space colony known as Side 3 proclaims independence as the Principality of Zeon and declares war on the Earth Federation. One year later, they are locked in a fierce battle for the Thunderbolt Sector, an area of space scarred by the wreckage of destroyed colonies.\n\nThe refugees from the Nanyang Alliance have slipped through the Earth Federation’s orbital blockade and arrived at Side 6, a neutral colony. Side 6’s conditions for accepting the refugees are strict—the Alliance refugees will have to disarm, leaving themselves defenseless. When an incoming Earth Federation patrol bent on hunting down the refugees kicks off a fierce battle near the colony, the Nanyang fleet begins a risky operation to reach safety. The battle rages as Side 6 struggles to maintain their neutrality in the face of a savage conflict that threatens to engulf them all.',14.99,'2022-10-18','mobile-suit-gundam-thunderbolt-vol-18-9781974732487_xlg.jpg',28.481,1,14,2,109),(56,'Bleach, Vol. 1','Temp. 1','Vol. 1','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nIchigo Kurosaki has always been able to see ghosts, but this ability doesn’t change his life nearly as much as his close encounter with Rukia Kuchiki, a Soul Reaper and member of the mysterious Soul Society. While fighting a Hollow, an evil spirit that preys on humans who display psychic energy, Rukia attempts to lend Ichigo some of her powers so that he can save his family; but much to her surprise, Ichigo absorbs every last drop of her energy. Now a full-fledged Soul Reaper himself, Ichigo quickly learns that the world he inhabits is one full of dangerous spirits and, along with Rukia--who is slowly regaining her powers--it’s Ichigo’s job to protect the innocent from Hollows and help the spirits themselves find peace.',9.99,'2004-07-06','bleach-vol1-cvr9781591164418_9781591164418_lg.jpg',18.981,1,20,2,109),(57,'Bleach, Vol. 2','Temp. 1','Vol. 2','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nImmediately after checking into the Kurosaki Clinic with a mysterious scar on his back, the muscle-bound Chad goes AWOL. Accompanying Chad is a talking parakeet imbued with the soul of a young boy named Yûichi. It doesn’t take newbie Soul Reaper Ichigo Kurosaki long to surmise that a Hollow must be involved--the strongest spirit he’s faced to date. Ichigo is about to discover that not every soul is bound for the Soul Society, especially if it’s tainted with innocent blood.',9.99,'2004-08-03','bleach-vol-2-9781591164425_lg.jpg',18.981,1,23,2,109),(58,'Bleach, Vol. 3','Temp. 1','Vol. 3','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nIchigo Kurosaki was a little boy when his mother passed away. One rainy day, Ichigo, whose ability to see the undead is a blessing and a curse, tried to stop a young girl from drowning in a nearby river. His mother, Masaki, ran after them, frantically trying to rescue her only son. Then everything went black, and Ichigo awoke only to discover his mother dead and the little girl gone.\n\nIt’s the anniversary of Masaki’s death, and the entire Kurosaki clan, along with former Soul Reaper Rukia Kuchiki, head to the cemetery to pay their respects. Sleeping demons rarely ever stay still and pretty soon Ichigo confronts the Grand Fisher, the Hollow that may be responsible for his mother’s demise. This and more in this action-packed volume of Tite Kubo’s manga smash-hit Bleach.\n\nImmediately after checking into the Kurosaki Clinic with a mysterious scar on his back, the muscle-bound Chad goes AWOL. Accompanying Chad is a talking parakeet imbued with the soul of a young boy named Yûichi. It doesn’t take newbie Soul Reaper Ichigo Kurosaki long to surmise that a Hollow must be involved--the strongest spirit he’s faced to date. Ichigo is about to discover that not every soul is bound for the Soul Society, especially if it’s tainted with innocent blood.',9.99,'2004-10-12','bleach-vol-3-cvr9781591164432_9781591164432_lg.jpg',18.981,1,14,2,109),(59,'Bleach, Vol. 4','Temp. 1','Vol. 4','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nA new reality-show craze is sweeping the nation, garnering legions of screaming fans (the majority of them being teenaged girls). But this program comes with a supernatural twist--the host, a media-savvy spiritualist, travels to local hotspots and performs exorcisms, live on national TV! Surly Soul Reaper Ichigo Kurosaki has his doubts about this primetime prima donna, and his assumptions are about to be put to the test--the show is heading straight for his neighborhood! What effect will this unprovoked media presence have on the fragile balance between Earth and the spirit world? Find out more in the fourth action-packed volume of Tite Kubo’s mega-manga hit Bleach.',9.99,'2004-12-07','bleach-vol-4-9781591164449_lg.jpg',18.981,1,30,2,109),(60,'Bleach, Vol. 5','Temp. 1','Vol. 5','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','\nIchigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nIchigo Kurosaki thought that Soul Reapers were the only ones hunting Hollows, but he was wrong. Enter Uryû Ishida, a Quincy, and possibly the last member of a powerful clan that died out over 200 years ago. Unlike Soul Reapers who strive to cleanse Hollows of their sins and send them to the Soul Society, Quincies adopt a more direct approach--they kill Hollows without hesitation. To demonstrate the supremacy of the Quincies’ ways, Uryû challenges Ichigo to a contest--bait is spread around the city, attracting a large number of unstable Hollows. Whoever defeats the most wins, regardless of the danger.\n\nAlso, Orihime and Chad, confronted with a host of Hollows terrorizing their friends, awaken to their own psychic abilities. Who is the strongest? Find this out and more in the action-packed fifth volume of Tite Kubo’s Bleach!',9.99,'2005-02-01','bleach-vol-5-cvr9781591164456_9781591164456_lg.jpg',18.981,1,37,2,109),(61,'Bleach, Vol. 6','Temp. 1','Vol. 6','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nIchigo Kurosaki may not know this, but the world he lives in is one predicated on balance--between the living and the dead, between everyday life and the Soul Society. Soul Reapers aren’t merely fighting Hollows, they are charged with the grand task of equalizing the balance between this life and the next. Naturally, if too much energy is channeled to one side, really bad things will happen--just as they’re happening now! Ichigo and Uryû’s competition inadvertently results in generating a leviathan of a Hollow whose sheer size is capable of tearing the Soul Reaper’s delicately constructed balance to ribbons. Find out what happens in Tite Kubo’s international manga smash-hit Bleach!',9.99,'2005-04-05','bleach-vol-6-9781591167280_lg.jpg',18.981,0,0,2,109),(62,'Bleach, Vol. 7','Temp. 1','Vol. 7','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nRukia Kuchiki, the ex-Soul Reaper responsible for Ichigo’s transformation, is on the lam. Her brethren at the Soul Society are quite displeased with the fact that she transferred the powers of a Soul Reaper to a human and have dispatched two of their strongest agents to neutralize the situation. Their mission is twofold: to return Rukia to the Soul Society so that she may pay for her crime and to deal with Ichigo--permanently. But an unlikely third party is standing in their way: Uryû Ishida, the Quincy!',9.99,'2005-05-31','bleach-vol-7-cvr9781591168072_9781591168072_lg.jpg',18.981,0,0,2,109),(63,'Bleach, Vol. 8','Temp. 1','Vol. 8','Part-time st