ns...',999,'2017-11-07','bleach-vol-71-9781421590950_lg.jpg',1898.1,1,33,2,109),(127,'Bleach, Vol. 72','Temp. 4','Vol. 72','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nWith Kyoraku gravely injured, it’ll be up to his adjutant Nanao to protect him. But can she master her newly revealed sword in time to make a difference? Meanwhile, Uryu’s plans will become clear when he comes face-to-face with Ichigo!',999,'2018-03-06','bleach-vol-72-9781421591667_lg.jpg',1898.1,1,22,2,109),(128,'Bleach, Vol. 73','Temp. 4','Vol. 73','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nFacing a powerful opponent, the mysterious Kisuke Urahara is forced to reveal his Bankai for the first time. Meanwhile, Ichigo finally makes it to Yhwach’s throne room, but what can he do against an enemy whose power is omnipotence?!',999,'2018-07-03','bleach-vol-73-9781421594347_lg.jpg',1898.1,1,33,2,109),(129,'Bleach, Vol. 74','Temp. 4','Vol. 74','Part-time student, full-time Soul Reaper, Ichigo is one of the chosen few guardians of the afterlife.','\nIchigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to protecting the innocent and helping the tortured spirits themselves find peace. Find out why Tite Kubo’s Bleach has become an international manga smash-hit!\n\nThe final battle against Yhwach gets under way as Ichigo and his allies reach the Quincy King’s throne room. Can Ichigo put an end to the thousand-year war between the Soul Reapers and Quincies? The emotional conclusion of Bleach is here!',999,'2018-10-02','bleach-vol-74-9781421596020_lg.jpg',1898.1,1,33,2,109),(130,'Bleach 20th Anniversary Edition, Vol. 1','ODA','Vol. 1','Ichigo Kurosaki never asked for the ability to see ghosts—he was born with the gift. When his family is attacked by a Hollow—a malevolent lost soul—Ichigo becomes a Soul Reaper, dedicating his life to','Celebrate 20 years of Bleach with this exclusive volume featuring cover art from the series launch on August 20, 2001 in Weekly Shonen Jump magazine!\n\nIchigo Kurosaki has always been able to see ghosts, but this ability doesn’t change his life nearly as much as his close encounter with Rukia Kuchiki, a Soul Reaper and member of the mysterious Soul Society. While fighting a Hollow, an evil spirit that preys on humans who display psychic energy, Rukia attempts to lend Ichigo some of her powers so that he can save his family; but much to her surprise, Ichigo absorbs every last drop of her energy. Now a full-fledged Soul Reaper himself, Ichigo quickly learns that the world he inhabits is one full of dangerous spirits and, along with Rukia—who is slowly regaining her powers—it’s Ichigo’s job to protect the innocent from Hollows and help the spirits themselves find peace.',999,'2022-08-02','bleach-20th-anniversary-edition-vol-1-9781974735983_lg.jpg',1898.1,1,22,2,109),(131,'El ataque del ángel','Temp. 1','Vol. 1','Neon Genesis Evangelion, Vol. 1','Año 2015. Una extraña figura avanza en el agua, se asoma un cartel hundido que dice “Gainax”, todo el ejército espera en la costa. Gendo dice que, después de 15 años, los ángeles han llegado, junto con el juicio que la humanidad no puede evitar. Shinji está en la estación de tren completamente inactiva de Hakone. Precisamente ese día su padre desea verle diez años después de abandonarlo. ',19.99,'1995-08-29','EVA-VOL_1.jpg',37.981,1,14,2,109),(132,'Chicos y Cuchillos','Temp. 1','Vol. 2','Neon Genesis Evangelion, Vol. 2','Shinji se instala en la muy desordenada casa de Misato, donde conoce a Pen-Pen. Al comenzar su primer día en la escuela, se descubre que es piloto de Eva. Touji Suzuhara lo golpea al hacerlo responsable del accidente de su hermana durante el combate previo. El Eva 1 sale al encuentro del Ángel 4. ',19.99,'1996-03-05','EVA-VOL_2.jpg',37.981,1,14,2,109),(133,'Cicatriz Blanca','Temp. 1','Vol. 3','Neon Genesis Evangelion, Vol. 3','Shinji y Touji finalmente hacen las paces. Shinji regresa a Nerv y en el sitio de la batalla anterior ve las manos quemadas de Gendo al revisar al Ángel. Misato le cuenta que sucedió durante el accidente de activación del Eva 00 y que lo hizo para salvar a Rei. Shinji no comprende semejante actitud de su padre. Shinji comienza a interesarse en Rei ya que ve que tiene una relación mucho más afectuosa con Gendo que el.',19.99,'1996-10-29','EVA-VOL_3.jpg',37.981,1,20,2,109),(134,'Asuka llega a Japón','Temp. 1','Vol. 4','Neon Genesis Evangelion, Vol. 4','Shinji, Rei, Misato y Ritsuko ven una filmación sobre el Eva 2 destruyendo al sexto Ángel en el Océano Índico, y se les informa que el Second Children viene a Japón. En la calle Kensuke, Touji y Shinji encuentran a una chica que golpea a toda una pandilla. De nuevo en Nerv Shinji descubre que esta chica se llama Asuka y es el piloto del Eva 2. Mientras Asuka se presenta formalmente con el resto del equipo, su acompañante, Kaji, le entrega a Gendo el embrión de Adam congelado.',19.99,'1997-10-17','EVA-VOL_4.jpg',37.981,1,23,2,109),(135,'Lápida','Temp. 1','Vol. 5','Neon Genesis Evangelion, Vol. 5','Kaji descubre que la organización Marduk es una fachada, mientras Gendo lo vigila. Asuka se muda a la casa de Misato, y Kensuke descubre que Misato fue ascendida a Mayor. Se organiza una fiesta pare celebrar ambos eventos, donde la dualidad de Asuka es expuesta y al mismo tiempo se le dice que no es necesario que finja. Shinji se siente feliz entre la gente. Rei es sometida a una prueba de sincronización con el Eva a 01, como parte del experimento del Dummy plug, y siente la presencia de alguien más dentro.',19.99,'1999-12-17','EVA-VOL_5.jpg',37.981,1,14,2,109),(136,'El Cuarto Elegido','Temp. 1','Vol. 6','Neon Genesis Evangelion, Vol. 6','La segunda división de Nerv en USA es vaporizada por un accidente en la instalación del órgano S2 en el Eva 04. El Eva 03 es trasladado a Japón. Gendo y Ritsuko terminan la construcción del Dummy plug. Mientras tanto Hikari cuestiona a Shinji sobre su amigo Touji, y este le cuenta a Asuka. La cual deduce la atracción de Hikari hacia Touji. Misato descubre que Touji es el candidato a Fourth Children.',19.99,'2000-12-15','EVA-VOL_6.jpg',37.981,1,30,2,109),(137,'La lucha de un hombre','Temp. 1','Vol. 7','Neon Genesis Evangelion, Vol. 7','Shinji está lleno de odio y aún en el interior del Eva, y comienza a destruir la sala de los candados. Gendo, sin dudarlo, ordena que aumenten la concentración de LCL al máximo. Shinji queda inconsciente. Asuka y Rei están fuera de la habitación de hospital de Shinji, él está soñando con Hikari buscando a Touji y el diciendo que su padre lo mató. Shinji ya no estará en Nerv, en la estación de tren,Shinji se despide de Misato, le dice que el no llevara a cabo el sueño de Misato de la paz de la humanidad. ',19.99,'2001-12-01','EVA-VOL_7.jpg',37.981,1,37,2,109),(138,'Madre','Temp. 1','Vol. 8','Neon Genesis Evangelion, Vol. 8','Shinji permanece dentro del Eva, Misato le pregunta a Kaji cuales son los verdaderos planes de Nerv y Gendo, Kaji le responde con un beso. Ritsuko se prepara para usar el plan de rescate que desarrollo su madre. El Eva con la forma de la madre de Shinji intenta convencerlo de que se quede. Rei siente un leve rechazo hacia Gendo y extraña a Shinji.',19.99,'2002-12-19','EVA-VOL_8.jpg',37.981,0,0,2,109),(139,'El quinto elegido','Temp. 1','Vol. 9','Neon Genesis Evangelion, Vol. 9','Asuka está deprimida por su pobre desempeño en las anteriores batallas, y su nivel de sincronización va decayendo. Shinji camino a la escuela (lugar donde no quiere ir para no encontrarse con Kensuke y Hikari) se encuentra con un chico tocando la novena sinfonía en un piano, el chico dice ser Kaworu , el quinto elegido. ',19.99,'2004-04-03','EVA-VOL_9.jpg',37.981,1,14,2,109),(140,'Lágrimas','Temp. 1','Vol. 10','Neon Genesis Evangelion, Vol. 10','Rei se encuentra con el ángel dentro de sí misma. Kaworu queda fuera de combate mientras el ángel penetra en el EVA 00 haciendo brotar del mismo las figuras de los ángeles anteriores. Se anula el congelamiento de la Unidad 01. Shinji sale al rescate del EVA 00. El ángel lo ataca tomando la forma de Rei. Ella se pregunta si en verdad refleja el deseo de su corazón.',19.99,'2006-02-25','EVA-VOL_10.jpg',37.981,1,20,2,109),(141,'Memorias en la Palma de la Mano','Temp. 1','Vol. 11','Neon Genesis Evangelion, Vol. 11','Rei III y Kaworu se encuentran y hablan de sus semejanzas y diferencias. Kaworu y Shinji se encuentran y tienen una discusión, tras lo cual Kaworu charla con Seele. Gendo Ikari ingiere el embrión de Adán. Misato y Hyuuga investigan y se acercan a la verdadera naturaleza de Kaworu, y luego Ritsuko le revela la verdad del mismo a Misato. Kaworu toma el control del EVA-02 y comienza descender al Terminal Dogma, siendo interceptado por Shinji.',19.99,'2007-06-19','EVA-VOL_11.jpg',37.981,1,23,2,109),(142,'Padre e hijo','Temp. 1','Vol. 12','Neon Genesis Evangelion, Vol. 12','La JSSDF comenzó su invasión y NERV debe detener su rápido avance. Debido a que los pilotos son los objetivos principales, NERV inició su búsqueda: Rei no aparece en ningún sitio, Shinji es incapaz de moverse y Asuka todavía permanece en estado de coma en su habitación del hospital. Los soldados de la JSSDF que han rodeado a Shinji con la intención de matarlo son interrumpidos por Gendo Ikari. ',19.99,'2010-04-03','EVA-VOL_12.jpg',37.981,1,39,2,109),(143,'My Hero Academia - 1','Temp. 1','Vol. 1','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.1','¿Cómo sería el mundo si el 80 por ciento de la población manifestara superpoderes llamados \"\"Quirks\"\"? ¡Héroes y villanos estarían luchando en todas partes! Ser un héroe significaría aprender a usar tu poder, pero ¿adónde irías a estudiar? ¡La academia de héroes, por supuesto! Pero, ¿qué harías si fueras uno del 20 por ciento que nació sin peculiaridades?\n\nEl estudiante de secundaria Izuku Midoriya quiere ser un héroe más que nada, pero no tiene ni una pizca de poder en él. Sin ninguna posibilidad de ingresar a la prestigiosa escuela secundaria UA para héroes en ciernes, su vida se parece cada vez más a un callejón sin salida. Luego, un encuentro con All Might, el héroe más grande de todos, le da la oportunidad de cambiar su destino...',9.99,'2015-08-04','my-hero-academia-vol-1-9781421582696_hr.jpg',18.981,1,33,2,109),(144,'My Hero Academia - 2','Temp. 1','Vol. 2','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.2','Entrar en la escuela secundaria de la UA fue bastante difícil, pero fue solo el comienzo del largo camino de Midoriya para convertirse en un superhéroe. Todos los nuevos estudiantes tienen poderes asombrosos y, aunque Midoriya ha heredado las habilidades de All Might, apenas puede controlarlas. ¡Además, a los estudiantes de primer año se les dice que tendrán que competir solo para evitar ser expulsados!',10.99,'2015-11-03','my-hero-academia-vol-2-9781421582702_hr.jpg',20.881,1,7,2,109),(145,'My Hero Academia - 3','Temp. 1','Vol. 3','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.3','Armado con el nombre del detective que lo ha estado siguiendo, Light acaba con sus problemas con el FBI mediante el uso del Death Note, el cual usó para matar a Raye Penber y a todos los detectives de Estados Unidos enviados a Japón. Al poco tiempo, Light cruza caminos con la prometida de Penber, Naomi Misora que, con sus propias conclusiones, se convierte en una amenaza para Light cuando ésta intenta contactar a L',9.99,'2016-02-02','my-hero-academia-vol-3-9781421585109_hr.jpg',18.981,1,27,2,109),(146,'My Hero Academia - 4','Temp. 1','Vol. 4','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.4','El festival deportivo UA High es una oportunidad para que los héroes en ciernes muestren sus habilidades y encuentren un mentor superhéroe. Los estudiantes ya han superado una agotadora ronda preliminar, pero ahora deben unirse para demostrar que son capaces de pasar a la siguiente etapa. Todo el país está mirando, al igual que las fuerzas sombrías que atacaron la academia...',9.99,'2016-05-03','my-hero-academia-vol-4-9781421585116_hr.jpg',18.981,1,41,2,109),(147,'My Hero Academia - 5','Temp. 1','Vol. 5','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.5','¡Las etapas finales del festival deportivo UA High prometen ser explosivas, ya que Uraraka se enfrenta a Bakugo en un enfrentamiento cara a cara! Bakugo nunca le da un respiro a nadie, y la multitud contiene la respiración cuando comienza la batalla. ¡Las finales llevarán a los estudiantes de la Clase 1-A a sus límites y más allá!',9.99,'2016-08-02','my-hero-academia-vol-5-9781421587028_hr.jpg',18.981,1,5,2,109),(148,'My Hero Academia - 6','Temp. 1','Vol. 6','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.6','El festival deportivo UA High es una oportunidad para que los héroes en ciernes muestren sus habilidades y encuentren un mentor superhéroe. Los estudiantes ya han superado una agotadora ronda preliminar, pero ahora deben unirse para demostrar que son capaces de pasar a la siguiente etapa. Todo el país está mirando, al igual que las fuerzas sombrías que atacaron la academia...',9.99,'2016-08-02','my-hero-academia-vol-6-9781421588667_hr.jpg',18.981,0,0,2,109),(149,'My Hero Academia - 7','Temp. 1','Vol. 7','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.7','Después del festival deportivo, los estudiantes de Clase 1-A comienzan sus prácticas. Midoriya va a estudiar con Gran Torino, quien una vez fue el mentor de All Might. Gran Torino parece ser un loco acabado, pero el viejo héroe todavía tiene más movimientos que un equipo de fútbol, ​​¡y Midoriya tiene mucho que aprender! En otro lugar, la Liga de Villanos representa otro complot siniestro y desata un nuevo enemigo aterrador.',9.99,'2016-11-01','my-hero-academia-vol-7-9781421590400_hr.jpg',18.981,1,32,2,109),(150,'My Hero Academia - 8','Temp. 1','Vol. 8','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.8','Midoriya ha aprendido algunos trucos de Gran Torino, pero algunas cosas solo deben experimentarse para entenderse. A pesar de que no está listo, cuando la Liga de Villanos ataca la ciudad de Hosu, Midoriya se apresura a ayudar a Ida, quien está involucrada en una lucha de vida o muerte con Hero Killer Stain. Stain tiene algunas ideas muy particulares sobre los héroes y su lugar en la sociedad, ¡y pretende purgar el mundo de todos los héroes que pueda encontrar!',9.99,'2017-02-07','my-hero-academia-vol-8-9781421591674_hr.jpg',18.981,1,6,2,109),(151,'My Hero Academia - 9','Temp. 1','Vol. 9','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.9','Los alumnos de la UA han llegado a la parte práctica de su examen final, ¡pero no esperaban tener que ganarles a sus propios profesores para poder aprobar! Junto con su archirrival Bakugo, Midoriya tiene que intentar enfrentarse a nada menos que al mismísimo All Might. Trabajar con Bakugo es una cosa, pero ¿dar todo lo que tiene para vencer a All Might es más de lo que Midoriya puede manejar? Y en una arena cercana, Yaoyorozu y Todoroki soportan una lucha similar. Mientras tanto, un nuevo y siniestro adversario se prepara para hacer un movimiento...',9.99,'2017-05-02','my-hero-academia-vol-9-9781421593401_xlg.jpg',18.981,1,38,2,109),(152,'My Hero Academia - 10','Temp. 1','Vol. 10','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.10','¡Se va al campamento de verano para Midoriya y los estudiantes de la UA! Pero estas no son unas vacaciones ordinarias: ¡es un entrenamiento de alto impacto en el que se espera que los estudiantes desarrollen sus Quirks aún más! Los maestros han establecido algunos desafíos difíciles, pero ninguno será tan difícil y tan cambiante como la amenaza que representa un nuevo grupo de enemigos. Lo que es aún peor es quién es el objetivo de los villanos y por qué...',9.99,'2017-08-01','my-hero-academia-vol-10-9781421594378_hr.jpg',18.981,1,26,2,109),(153,'My Hero Academia - 11','Temp. 1','Vol. 11','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.11','El secuestro de Bakugo por parte de la Liga de Villanos fue un movimiento cuidadosamente calculado diseñado para atraer a los héroes, en particular a All Might, y destruirlos. ¡Midoriya y sus amigos se embarcaron en una misión de rescate que finalmente atrae no solo a All Might sino también a varios otros héroes! Las bajas aumentan, hasta que finalmente aparece la mente maestra de la trama: All for One, ¡el único villano lo suficientemente poderoso como para enfrentarse a All Might cara a cara y posiblemente ganar!',9.99,'2017-08-06','my-hero-academia-vol-11-9781421595832_xlg .jpg',18.981,1,4,2,109),(154,'My Hero Academia - 12','Temp. 1','Vol. 12','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.12','La Liga de Villanos ha secuestrado a Bakugo, y la publicidad negativa resultante ha provocado un gran alboroto en UA. Con la confianza del público en los héroes amenazada, la facultad se reúne para decidir qué hacer. Pero Midoriya y los estudiantes de la Clase 1-A tienen sus propios planes: ¡una operación para rescatar a Bakugo que podría hacer que los echen de la escuela!',9.99,'2017-11-07','my-hero-academia-vol-12-9781421597010_hr.jpg',18.981,0,0,2,109),(155,'My Hero Academia - 13','Temp. 1','Vol. 13','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.13','Los estudiantes de la Clase 1-A han alcanzado otro hito: el Examen de Licencia Provisional. Después de pasar la primera parte de la prueba, se preparan para la siguiente fase, que tiene lugar en un área de desastre simulada. Midoriya y sus amigos tienen que rescatar a tantas víctimas como puedan, y aunque técnicamente se supone que los estudiantes de la preparatoria Shiketsu rival están ayudando, ¡la competencia entre ellos es feroz e incluso peligrosa! A medida que se desarrolla el escenario y llegan los villanos para cambiar las cosas, los estudiantes de la UA tendrán que encontrar nuevas formas de trabajar entre ellos y hacer uso de sus Quirks.',9.99,'2018-06-05','my-hero-academia-vol-13-9781421598031_hr.jpg',18.981,1,27,2,109),(156,'My Hero Academia - 14','Temp. 1','Vol. 14','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.14','¡Las vacaciones de verano terminaron y los estudiantes de UA High volvieron a la escuela! Pero antes de que puedan comenzar las clases, Midoriya y Bakugo necesitan resolver un problema entre ellos que ha tardado mucho en llegar. Incluso si pueden superar este bache en el camino para convertirse en superhéroes, los obstáculos seguirán aumentando más y más: los estudios sobre el trabajo del héroe en el próximo año los acercarán aún más a su meta... ¡o a su destrucción!',9.99,'2018-08-07','my-hero-academia-vol-14-9781421599472_xlg.jpg',18.981,1,38,2,109),(157,'My Hero Academia - 15','Temp. 1','Vol. 15','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.15','Un nuevo y siniestro enemigo aparece en la forma de Chisaki Kai, el joven líder de la pandilla Hassaikai yakuza. Buscando llenar el vacío de poder dejado por All For One, Chisaki se pone en contacto con la Liga de Villanos para obtener un posible apoyo. Cuando un encuentro casual con una niña asustada pone a Midoriya y su mentora Mirio cara a cara con Chisaki, ninguno de ellos tiene idea de cuánto van a cambiar sus vidas...',9.99,'2018-10-02','my-hero-academia-vol-15-9781974701001_xlg.jpg',18.981,1,26,2,109),(158,'My Hero Academia - 16','Temp. 1','Vol. 16','Midoriya hereda el superpoder del mayor héroe del mundo, pero la grandeza no será fácil. Vol.16','La pandilla criminal Hassaikai, dirigida por el joven jefe Chisaki, ha estado trabajando en un plan para distribuir una droga que destruye Quirk. La clave de este malvado plan es la joven Eri, prisionera en el escondite de Chisaki. Nighteye les pide a otros héroes que formen un equipo para lanzar un intento de rescate, ¡y los estudiantes de la Clase 1-A van a ir al foso de los leones con ellos! Pero Nighteye, que puede ver el futuro, se niega a mirar el destino de cualquiera en la misión...',10.99,'2018-12-04','my-hero-academia-vol-16-9781974702558_xlg.jpg',20.881,0,0,2,109);
